import { useState } from "react";

export function AgeCounter(props){
    const [age, setAge] = useState(30);

    function increaseAge() {
        setAge(age+1);
    }

    return (<div>
        <button onClick={increaseAge}>Increase Age</button>
        <p>You are {age} years old</p>
    </div>);
}
